$(document).ready(()=>{$.ajax({url:"http://localhost:4000/users/list/approved",method:"GET",crossDomain:!0,xhrFields:{withCredentials:!1},success:t=>{t&&t.forEach((t,e)=>{var d=t.due.split(/[- :]/),t=(new Date(...d),`
                                        <tr>
                                            <td>${t.buyer}</td>
                                            <td>${t.name}</td>
                                            <td>${t.due}</td>
                                            <td>P${t.amount}</td>
                                        </tr>
                                        `);$("#table_data").append(t)})},error:t=>{console.log(t)}})});